import { makeStyles, mergeClasses, shorthands } from '@griffel/react';
import { typographyStyles } from '@fluentui/react-theme';
import { createFocusOutlineStyle } from '@fluentui/react-tabster';
export const dialogTitleClassNames = {
    root: 'fui-DialogTitle',
    action: 'fui-DialogTitle__action'
};
/**
 * Styles for the root slot
 */ const useStyles = makeStyles({
    root: {
        gridRowStart: 1,
        gridRowEnd: 1,
        gridColumnStart: 1,
        gridColumnEnd: 3,
        ...typographyStyles.subtitle1,
        ...shorthands.margin(0)
    },
    rootWithoutAction: {
        gridColumnEnd: 4
    },
    action: {
        gridRowStart: 1,
        gridRowEnd: 1,
        gridColumnStart: 3,
        justifySelf: 'end',
        alignSelf: 'start'
    }
});
/**
 * Styles to be applied on internal elements used by default action on non-modal Dialog
 * @internal
 */ export const useDialogTitleInternalStyles = makeStyles({
    button: {
        position: 'relative',
        boxSizing: 'content-box',
        backgroundColor: 'inherit',
        color: 'inherit',
        fontFamily: 'inherit',
        fontSize: 'inherit',
        cursor: 'pointer',
        lineHeight: 0,
        ...shorthands.overflow('visible'),
        ...shorthands.padding(0),
        ...shorthands.borderStyle('none'),
        WebkitAppearance: 'button',
        textAlign: 'unset',
        ...createFocusOutlineStyle()
    }
});
/**
 * Apply styling to the DialogTitle slots based on the state
 */ export const useDialogTitleStyles_unstable = (state)=>{
    const styles = useStyles();
    state.root.className = mergeClasses(dialogTitleClassNames.root, styles.root, !state.action && styles.rootWithoutAction, state.root.className);
    if (state.action) {
        state.action.className = mergeClasses(dialogTitleClassNames.action, styles.action, state.action.className);
    }
    return state;
};
